CREATE DATABASE employees
  DEFAULT CHARACTER SET utf8
  DEFAULT COLLATE utf8_general_ci;

USE employees;

create table EMP (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	bio TEXT,
	department VARCHAR(50),
	city VARCHAR(50),
	mobile VARCHAR(50),
	birth_day DATE
);
